import React from "react";
import { MapContainer, Marker,Popup} from "@vis.gl/react-google-maps";

const Map = ({ data }) => {

  const parseLocation = (location) => {
    const match = location.match(/POINT \(([-\d.]+) ([-\d.]+)\)/);
    return match ? [parseFloat(match[2]), parseFloat(match[1])] : null;
  };


  return (
    <div className="map-container">
      <MapContainer
        style={{ borderRadius: "20px" }}
        defaultZoom={13}
        gestureHandling={"greedy"}
        disableDefaultUI
      >
         {data.map((item, index) => {
          const coords = parseLocation(item["Vehicle Location"]);
          return (
            coords && (
              <Marker key={index} position={coords}>
                <Popup>
                  {item.Make} {item.Model} - {item.City}, {item.State}
                </Popup>
              </Marker>
            )
          );
        })}
      </MapContainer>
    </div>
  );
}

export default Map;
